%%_________input variables_________________
% D  轴颈直径
% c  半径间隙 单位为m
% L  轴承长度
% l  内衬厚度
% nd 水的粘度 Pa.s
% w  自转转速 r/min--rad/s
% E  内衬弹性模量
% v  橡胶泊松比
% v0 当量泊松比
% W  轴承外载荷
% DZ 水槽数量
% DH 水槽角度
%_________output variable________
% H 轴承水膜厚度分布
% P 轴承水膜
%___________testing data_________________
clc;close all;
D=0.361; c=0.001; L=0.27;l=0.0145;nd=0.00089;w=50*2*pi/60; E1=270*10^6; v1=0.45; E2=207*10^9;v2=0.3;DZ=6; DH=pi/50;M=11.5; g=9.816;
Qx=0;Qy=500; Ra=5*10^(-6); rendaX=10*Ra;rendaY=10*Ra;Yp=24*10^6;gama=1;Hard=60*10^6; VY=0;VX=w*D/2;
W=Qy+M*g;
%__________formal function_________________
R=D/2;E=2*((1-v1^2)/E1+(1-v2^2)/E2)^(-1);
VX=VX*nd/(E*R);VY=VY*nd/(E*R);
VV=6.*nd.*w.*R.^2./(c.^2); %恢复成有量纲压力时的比例计算
m=60; n=60; %轴、周向等分数；
% 对z归一化采用 z=ZR 轴向坐标轴对称分布z=(-L/2, L/2)
deltL=2*(L/2)/m; %轴向等分间距
deltsita=(2*pi-DZ*DH)/DZ/n; %周向角度等分大小
nk=round(DH/deltsita);DX=deltL*R;DY=deltL;
e=0.6;fai=0.1; %初始偏心量和偏位角
X0=c*e*sin(fai);Y0=c*e*cos(fai); %初始位置
Xv0=0;Yv0=0; %速度初值
Fn=0;Dt=0.001;
Dc=Dccal(m,n,DX,DY);
errPWJ=1;ZHXS=0.02;ERR2=0.02;Xfai=0.01;pbd=1;
while (errPWJ>ERR2)
    errPX=1;ERR1=0.001; kgh=0;
    while (errPX>ERR1)
        PT=[];HT=[];FN=zeros(DZ,1);
        for dk=1:DZ
            csj=(dk-1)*(2*pi/DZ);
            ERR3=1.0e-3; %误差
            PK=zeros(n+1,m+1); H=zeros(n+1,m+1);%各点赋初值（重要）
            PD=zeros(nk,m);HD=NaN.*zeros(nk,m);
            k=1; %迭代计数
            while k>0
                P=PK; %下次迭代赋值
                [H,Hh,Ks]=Hcalcu(csj,deltsita,fai,e,E,c,P,l,Ra,VV,Dc,n,m);
                havera=l*mean(H(:));
                if isnan(havera)
                    disp 膜厚为NaN，出错
                    return
                end
                [Sx,Sy]=SxSyCalcu(havera,Ra,gama);
                Ss=SsCalcu(havera,Ra,gama);
                Sc=ScCalcu(havera,Ra);
                PK=Pcalcu(H,deltsita,deltL,P,Sx,Sy,Ss,Sc,n,m,VY,VX);
                if Ks~=0
                    disp 膜厚小于粗糙度，进入混合润滑状态
                    Sd=Ks*(2*pi/DZ-DH)*D*L/2;
                    [~,~,Fn]=HaCalcu(PK,Sd,Ra,Yp,rendaX,rendaY,E,VV,Hard,Hh,c,n,m);
                    break
                end
                [sumt,~,sum2]=SumErr(PK,P,n,m);
                if (sum2<10^(-5))&&(k>20)
                    break;
                end
                if sumt<=ERR3
                    break;
                end
                if k>5000
                    break
                end
                k=k+1;
            end
            PPK=PK(1:n,1:m);HK=H(1:n,1:m);PT=[PT;PPK;PD];HT=[HT;HK;HD];FN(dk)=Fn;
        end
        ee=e;
        [Fx,Fy,F,Xa,Ya,Xv,Yv,X,Y,e,~,~]=Fcalcu(deltsita,VV,PT,FN,HT,nk,DZ,fai,R,L,c,Qx,Qy,M,g,Dt,X0,Y0,Xv0,Yv0,n,m);
        errPX=abs((ee-e)/ee)
        if e>1
            disp “超出最大承载能力”
            continue
        end
    end
    %% 依据偏差量对迭代比例进行控制
    if kgh==1
        fai=fai-0.75*Xfai;
    else
        errPW=abs(Fx/Fy);
        if errPW>0.5
            xsx=1;
        elseif errPW>0.1
            xsx=0.5;
        elseif errPW<0.1
            xsx=0.1;
        elseif errPW<0.01
            xs=0.01;
        end
        Xfai=xsx*((ERR2*abs(Fy)-abs(Fx))/abs(Fy))*fai;
        errPWJ=abs(errPW-ZHXS)/ZHXS
        fai=fai-Xfai
    end
    pbd=pbd+1;
    X0=X;Y0=Y;Xv0=Xv;Yv0=Yv;
end
